INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (44, 0, "獣人族", "人助け、応援", 16, 2, 8, 100101, "ヒヨリ", "人助けが大好き！　前向き格闘娘", 155, "トゥインクルウィッシュ", 27, "A", "東山奈央", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (47, 0, "ヒューマン", "料理、人間観察", 17, 2, 4, 100201, "ユイ", "戦闘のサポートが得意な、心優しい少女", 158, "トゥインクルウィッシュ", 5, "O", "種田梨沙", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (46, 0, "魔族", "読書、乗馬、お茶", 18, 2, 1, 100301, "レイ", "クールで何事にも真っ直ぐな剣士", 163, "トゥインクルウィッシュ", 12, "B", "早見沙織", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (27, 0, "ヒューマン", "いたずら、探検", 9, 5, 8, 100401, "ミソギ", "探検好きのイタズラっ子", 128, "リトルリリカル", 10, "O", "諸星すみれ", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪");
