INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (42, 0, "魔族", "サックス", 13, 7, 11, 100601, "アカリ", "甘え上手なみんなの人気者", 150, "悪魔偽王国軍（ディアボロス）", 22, "O", "浅倉杏美", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (32, 0, "魔族", "プリンを食べること", 14, 7, 1, 100701, "ミヤコ", "プリン大好きゴースト娘", 130, "悪魔偽王国軍（ディアボロス）", 23, "B", "雨宮天", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (40, 0, "エルフ", "鏡で自分を見ること", 14, 15, 10, 100801, "ユキ", "ボクは誰よりも美しい", 150, "ヴァイスフリューゲル　ランドソル支部", 10, "AB", "大空直美", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (45, 0, "魔族", "小説執筆", 17, 13, 7, 100901, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」", 159, "トワイライトキャラバン", 5, "A", "髙野麻美", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (42, 0, "獣人族", "空想、ぬいぐるみ集め", 16, 10, 9, 101001, "マホ", "マホマホ王国のプリンセス", 155, "自警団（カォン）", 22, "O", "内田真礼", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (44, 0, "ヒューマン", "お裁縫", 15, 3, 8, 101101, "リノ", "人懐っこくてマシンガントークな妹系少女", 156, "ラビリンス", 25, "A", "阿澄佳奈", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (46, 0, "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝", 17, 6, 12, 101201, "ハツネ", "みんなのために超能力を使う眠り姫", 156, "フォレスティエ", 24, "A", "大橋彩香", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！");
