INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (52, 0, "魔族", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 23, 14, 8, 101801, "イオ", "多くの男性を魅了する無垢な女教師", 162, "ルーセント学院", 14, "B", "伊藤静", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (21, 0, "獣人族", "かわいいもの集め", 10, 5, 4, 102001, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪", 117, "リトルリリカル", 3, "O", "日高里菜", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (40, 0, "ヒューマン", "観劇、おままごと", 12, 9, 6, 102101, "クルミ", "泣き虫で臆病な守ってあげたい女の子", 150, "サレンディア救護院", 9, "B", "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (40, 0, "魔族", "ゲーム全般", 13, 7, 11, 102201, "ヨリ", "人見知りであまのじゃくな女の子", 150, "悪魔偽王国軍（ディアボロス）", 22, "O", "原紗友里", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…");
