INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (43, 0, "ヒューマン", "ご奉仕", 15, 9, 12, 102501, "スズメ", "お嬢さまのためにがんばるドジっ娘メイド", 154, "サレンディア救護院", 12, "O", "悠木碧", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…");
