INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (43, 0, "エルフ", "経営、お茶会", 17, 9, 10, 102801, "サレン", "救護院を経営する優しい庶民派お嬢様", 156, "サレンディア救護院", 4, "A", "堀江由衣", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！");
