INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (42, 0, "魔族", "占い", 18, 7, 12, 103101, "シノブ", "占いが得意な霊能少女", 157, "悪魔偽王国軍（ディアボロス）", 22, "AB", "大坪由佳", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
