INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (49, 0, "ヒューマン", "傭兵などのアルバイト", 20, 12, 11, 108001, "ミフユ（サマー）", "仕事も私事も効率優先な傭兵少女", 163, "メルクリウス財団", 11, "O", "田所あずさ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (42, 0, "魔族", "占い", 18, 7, 12, 108101, "シノブ（ハロウィン）", "占いが得意な霊能少女", 157, "悪魔偽王国軍（ディアボロス）", 22, "AB", "大坪由佳", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (32, 0, "魔族", "プリンを食べること", 14, 7, 1, 108201, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘", 130, "悪魔偽王国軍（ディアボロス）", 23, "B", "雨宮天", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (22, 0, "魔族", "ファッション誌鑑賞、コスメ集め", 11, 14, 1, 108301, "ミサキ（ハロウィン）", "ちょっとおませな恋に恋する女の子", 120, "ルーセント学院", 3, "A", "久野美咲", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (46, 0, "ヒューマン", "各種楽器", 17, 4, 6, 108401, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女", 163, "カルミナ", 3, "O", "福原綾香", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (40, 0, "ヒューマン", "観劇、おままごと", 12, 9, 6, 108501, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子", 150, "サレンディア救護院", 9, "B", "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (38, 0, "ヒューマン", "屋内でできる遊び", 14, 9, 5, 108601, "アヤネ（クリスマス）", "ぷうきちといつも一緒！", 148, "サレンディア救護院", 10, "B", "芹澤優", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (44, 0, "獣人族", "人助け、応援", 16, 2, 8, 108701, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘", 155, "トゥインクルウィッシュ", 27, "A", "東山奈央", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (47, 0, "ヒューマン", "料理、人間観察", 17, 2, 4, 108801, "ユイ（ニューイヤー）", "戦闘のサポートが得意な、心優しい少女", 158, "トゥインクルウィッシュ", 5, "O", "種田梨沙", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
