INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (43, 0, "魔族", "実験、裁縫、料理", 16, 13, 7, 109001, "エリコ（バレンタイン）", "運命の相手に一途すぎる乙女", 154, "トワイライトキャラバン", 30, "B", "橋本ちなみ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (54, 0, "ヒューマン", "家事全般", 18, 3, 10, 109101, "シズル（バレンタイン）", "お姉ちゃんがお世話してあげるからねっ！", 168, "ラビリンス", 24, "O", "生天目仁美", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！");
