INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (45, 0, "ヒューマン", "食べること、眠ること", 15, "", 2, 109301, "ルゥ", "マナリア魔法学院の新入生", 144, "？？？", 4, "O", "こやまきみこ", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (67, 0, "半人半竜", "ピアノ", 17, "", 11, 109401, "グレア", "人を超越した力を有す心優しい竜姫", 167, "？？？", 3, "B", "福原綾香", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね");
